import React, { useState } from "react";


const Contact = (req, res) => {
    const [name, setName] = useState("");
    const [lastName, setLastName] = useState("");
    const [email, setEmail] = useState("");
    const [message, setMessage] = useState("");
    const [sent, setSent] = useState(false);

    const handleName = (e) => {
        setName(e.target.value);
    }
    return (
        <div className="contener">
            <form className = "formContact">
                <div>
                    <label  htmlFor="name">Nom</label>
                    <input value = {name} className="name" type="text" name="name" placeholder="Votre nom" onChange = {handleName} />
                </div>
                <div>
                    <label htmlFor="prenom">Pr√©nom</label>
                    <input className="prenom" type="text" name="prenom" placeholder="Votre prenom" />
                </div>
                <div>
                    <label htmlFor="email">E-mail</label>
                    <input className="email" type="email" name="email" placeholder="Vote E-mail" />
                </div>

                <div>
                    <label htmlFor="message">Message</label>
                    <textarea cols = "30" rows = "5" className="message" type="text" name="message" placeholder="Vote message" />
                </div>
                 <div>{name}</div>
                <div>
                    <button type = "submit">Envoyer</button>
                </div>
            </form>

        </div>
    )
}


export default Contact;
